import { Component } from '@angular/core';

@Component({
  selector: 'app-post',
  templateUrl: './post.component.html',
  styleUrls: ['./post.component.scss']
})
export class PostComponent {
  menuItems = [
    { title: 'Home', link: '/home' },
    { title: 'About', link: '/about' },
    { title: 'Contact', link: '/contact' }
  ];
}
